"877":{"id":"877","name":"Scarface: A Vergonha de uma Nação","slug":"scarface-a-vergonha-de-uma-nacao","original_title":"Scarface","overview":"Tony \"Scarface\" Camonte trabalha para Johnny Lovo, um ambicioso gangster que deseja criar um império do crime em Chicago. Nesta guerra pelo comando, o chefe da quadrilha rival fora assassinado por Tony e a polícia suspeita que Lovo o tenha pago para tal feito. Tony logo ganha respeito na quadrilha pelo feito e espera pacientemente pelo momento exato de liquidar com seu chefe e assumir o comando do bando. No comando, Tony ganha dinheiro como jamais sonhou e passa viver tranqüilo e luxuosamente. Mas sua tranquilidade duraria pouco tempo, pois sua irmã, Cesca Camonte, envolve-se com Guino Rinaldo, seu \"braço direito\", obrigando-o a tomar medidas drásticas.","first_air_date":"1932-04-09","runtime":93,"episode_run_time":[93],"vote_average":7.4,"created_by":["The Caddo Company","United Artists"],"production_companies":[{"name":"The Caddo Company"},{"name":"United Artists"}],"cast":["Paul Muni","Ann Dvorak","Karen Morley","Osgood Perkins","C. Henry Gordon"],"backdrop_path":"https://image.tmdb.org/t/p/original/3i6H4cVfvWh55sN1iXyeb8Q50nY.jpg","poster_path":"https://image.tmdb.org/t/p/original/8auY5JIiqgarYPH2QYHJ9bh2agL.jpg","certification":"N/A","genres":["Crime","Drama"],"trailer":"N/A"},
