"804":{"id":"804","name":"A Princesa e o Plebeu","slug":"a-princesa-e-o-plebeu","original_title":"Roman Holiday","overview":"A Princesa Anne embarca em uma turnê por diversas capitais europeias e que é altamente explorada pela imprensa. Quando ela e sua comitiva real chegam em Roma, ela começa a se rebelar contra o seu horário extremamente regrado. Uma noite Anne dá uma escapulida de seu quarto, pula na traseira de um caminhão de entregas e escapa seu luxuoso confinamento. No entanto, um sedativo que ela foi forçada a tomar mais cedo começa a fazer efeito, e logo a princesa está prestes a dormir em um banco público. Ela é encontrada por Joe Bradley, um repórter de um jornal americano correspondente em Roma. Ele a leva até o seu apartamento. Na manhã seguinte, Joe corre para cobrir a conferência de imprensa da princesa Anne, sem saber que ela está dormindo em seu sofá. Na hora em que ele percebe a sua boa sorte, Joe promete ao seu editor uma entrevista exclusiva com a princesa.","first_air_date":"1953-08-26","runtime":118,"episode_run_time":[118],"vote_average":7.9,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Audrey Hepburn","Gregory Peck","Eddie Albert","Hartley Power","Harcourt Williams"],"backdrop_path":"https://image.tmdb.org/t/p/original/6f50k0bAekjxDvVvGC1SupJSzf4.jpg","poster_path":"https://image.tmdb.org/t/p/original/1je8W40McnM64mtysk8jhNgoTay.jpg","certification":"Livre","genres":["Romance","Comédia","Drama"],"trailer":"N/A"},
"9279":{"id":"9279","name":"Um Herói de Brinquedo","slug":"um-heroi-de-brinquedo","original_title":"Jingle All the Way","overview":"Um homem de negócios chega atrasado na aula de caratê do seu filho, que recebeu a faixa azul. Para tentar compensar, ele promete ao menino que lhe dará qualquer coisa que ele peça no Natal. O garoto então pede o \"Turbo Man\", o brinquedo sensação do momento e sonho de todas as crianças. Acontece que já véspera de Natal e o brinquedo não existe em lugar nenhum, com todos os estoques já esgotados. Ele então se propõe a cumprir a promessa, não importando o quanto isto lhe custe. Mas, além de se meter em uma série de complicações, ainda tem de ser mais esperto que um carteiro, que tem o mesmo objetivo dele e igualmente obstinado no seu intento.","first_air_date":"1996-11-21","runtime":94,"episode_run_time":[94],"vote_average":6.0,"created_by":["1492 Pictures","20th Century Fox","Fox Family Films"],"production_companies":[{"name":"1492 Pictures"},{"name":"20th Century Fox"},{"name":"Fox Family Films"}],"cast":["Arnold Schwarzenegger","Sinbad","Phil Hartman","Rita Wilson","Robert Conrad"],"backdrop_path":"https://image.tmdb.org/t/p/original/rnn6sGMGPpM8VfVmCMFxsjKvz7q.jpg","poster_path":"https://image.tmdb.org/t/p/original/eWq3BvXYERCbTo1aw6DRmKaCpVo.jpg","certification":"L","genres":["Família","Comédia","Aventura"],"trailer":"N/A"},
"9366":{"id":"9366","name":"Donnie Brasco","slug":"donnie-brasco","original_title":"Donnie Brasco","overview":"Nos anos 70, policial usa o nome de Donnie Brasco para infiltrar-se entre mafiosos. Um criminoso mais velho o toma sob sua tutela, ensinando-lhe os caminhos do crime. Mas ele coloca sua vida pessoal em xeque, pondo em risco sua missão.","first_air_date":"1997-02-27","runtime":125,"episode_run_time":[125],"vote_average":7.5,"created_by":["Phoenix Pictures","Mark Johnson Productions","Baltimore Pictures","TriStar Pictures","Mandalay Pictures"],"production_companies":[{"name":"Phoenix Pictures"},{"name":"Mark Johnson Productions"},{"name":"Baltimore Pictures"},{"name":"TriStar Pictures"},{"name":"Mandalay Pictures"}],"cast":["Johnny Depp","Al Pacino","Michael Madsen","Bruno Kirby","James Russo"],"backdrop_path":"https://image.tmdb.org/t/p/original/7aWpb0sfGteTomS9DP5NWDeD7DL.jpg","poster_path":"https://image.tmdb.org/t/p/original/xtKLvpOfARi1XVm8u2FTdhY5Piq.jpg","certification":"16","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
"59861":{"id":"59861","name":"Larry Crowne: O Amor Está de Volta","slug":"larry-crowne-o-amor-esta-de-volta","original_title":"Larry Crowne","overview":"Larry Crowne (Tom Hanks) trabalha há anos em uma loja, onde já foi escolhido por nove vezes como o funcionário do mês. Um dia, para sua surpresa, ele é demitido por não ter curso superior. Precisando recomeçar do zero, ele resolve se matricular na faculdade. Um dos cursos que realiza é o de oratório, ministrado por Mercedes Tainot (Julia Roberts), que está desanimada devido ao desinteresse dos alunos por sua matéria. A vida na faculdade faz com que Larry ganhe novos amigos, mude seu estilo de vida e se aproxime, cada vez mais, de Mercedes.","first_air_date":"2011-06-30","runtime":98,"episode_run_time":[98],"vote_average":6.0,"created_by":["Vendôme Pictures","Playtone"],"production_companies":[{"name":"Vendôme Pictures"},{"name":"Playtone"}],"cast":["Tom Hanks","Julia Roberts","Bryan Cranston","Cedric the Entertainer","Pam Grier"],"backdrop_path":"https://image.tmdb.org/t/p/original/hl5twrpQBa1VhpsaLFphByGUGt.jpg","poster_path":"https://image.tmdb.org/t/p/original/rB2H98T6xiOsc6KrtDjXbIWoOWy.jpg","certification":"10","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
