"24420":{"id":"24420","name":"Te Amarei Para Sempre","slug":"te-amarei-para-sempre","original_title":"The Time Traveler's Wife","overview":"Henry DeTamble viaja pelo tempo involuntariamente. Numa de suas viagens, ele conhece a pequena Clare, que se apaixona por ele imediatamente. Ano após ano, ela espera sempre no mesmo lugar que este estranho viajante retorne. Até que os dois, finalmente, se encontram e a paixão começa. Porém, o curso da vida de Clare é normal e, quando ela menos espera, seu grande amor desaparece, sem data para retornar. Como poderia um romance suportar a estas indas e vindas?","first_air_date":"2009-08-14","runtime":107,"episode_run_time":[107],"vote_average":6.9,"created_by":["New Line Cinema","Plan B Entertainment","Nick Wechsler Productions"],"production_companies":[{"name":"New Line Cinema"},{"name":"Plan B Entertainment"},{"name":"Nick Wechsler Productions"}],"cast":["Eric Bana","Rachel McAdams","Michelle Nolden","Arliss Howard","Ron Livingston"],"backdrop_path":"https://image.tmdb.org/t/p/original/3B4DbexR2hXINqJN6LqhmmAaVeS.jpg","poster_path":"https://image.tmdb.org/t/p/original/i8nNtrji1DRpVIyJL4br2Di4CRi.jpg","certification":"N/A","genres":["Drama","Romance","Fantasia"],"trailer":"PXGMKzphrtI"},
