"5955":{"id":"5955","name":"A Promessa","slug":"a-promessa","original_title":"The Pledge","overview":"Jerry Black (Jack Nicholson) é um policial veterano que vive em Nevada e está prestes a se aposentar. Em seu último dia de serviço ele recebe como missão conferir o local onde ocorreu o assassinato de uma garota de 7 anos e avisar sua família do ocorrido. Com a mãe desesperada, Jerry promete que encontrará o culpado do crime e, com isso, resolve investigar o caso auxiliado por Stan Krolak (Aaron Eckhart), outro policial. Juntos eles chegam até Toby Jay Wadenah (Benicio Del Toro), um homem com problemas mentais que assume a autoria do crime e logo depois se suicida. Krolak considera o caso enc, mas Jerry não acredita que Toby Jay seja o assassino e, mesmo aposentado, decide continuar as investigações por conta própria.","first_air_date":"2001-01-19","runtime":123,"episode_run_time":[123],"vote_average":6.6,"created_by":["Morgan Creek Entertainment","Franchise Pictures","Clyde Is Hungry Films","Pledge Productions","Epsilon Motion Pictures","Warner Bros. Pictures"],"production_companies":[{"name":"Morgan Creek Entertainment"},{"name":"Franchise Pictures"},{"name":"Clyde Is Hungry Films"},{"name":"Pledge Productions"},{"name":"Epsilon Motion Pictures"},{"name":"Warner Bros. Pictures"}],"cast":["Jack Nicholson","Helen Mirren","Aaron Eckhart","Robin Wright","Sam Shepard"],"backdrop_path":"https://image.tmdb.org/t/p/original/o62VYsoyEUYgYMn21Thd9GHTuUE.jpg","poster_path":"https://image.tmdb.org/t/p/original/of1WVN0Z8KB8lnbrpFOStSrctuR.jpg","certification":"N/A","genres":["Crime","Drama","Mistério","Thriller"],"trailer":"N/A"},
"4964":{"id":"4964","name":"Ligeiramente Grávidos","slug":"ligeiramente-gravidos","original_title":"Knocked Up","overview":"A jornalista de sucesso Alison Scott encontra um grande obstáculo depois que uma noite amorosa com Ben, um rapaz irresponsável que ela conheceu em um bar, resulta em gravidez. Primeiro ela pensa em criar o filho sozinha, mas depois decide procurar Ben para contar sobre a novidade e dar a ele uma chance de ser um pai presente. No entanto, ele não tem certeza se está pronto para ser pai, e os dois se perguntam se seriam parceiros compatíveis.","first_air_date":"2007-06-01","runtime":129,"episode_run_time":[129],"vote_average":6.3,"created_by":["Apatow Productions","Universal Pictures"],"production_companies":[{"name":"Apatow Productions"},{"name":"Universal Pictures"}],"cast":["Seth Rogen","Katherine Heigl","Paul Rudd","Leslie Mann","Jason Segel"],"backdrop_path":"https://image.tmdb.org/t/p/original/lavWAUXVe7vHlKhZEGmfVLaVd4S.jpg","poster_path":"https://image.tmdb.org/t/p/original/2VywbKoUEcXY8lO7gBhR6csX0P4.jpg","certification":"16","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
"460019":{"id":"460019","name":"Verdade ou Desafio","slug":"verdade-ou-desafio","original_title":"Truth or Dare","overview":"Olivia, Lucas e um grupo de amigos viajam ao México como uma despedida antes da formatura. Lá, um estranho convence um dos estudantes a jogar um aparentemente inofensivo jogo de verdade ou desafio com os outros. Ao começar, o jogo desperta algo maligno - um demônio que força os amigos a compartilharem segredos sombrios e confrontarem seus medos mais profundos. A regra é simples, porém cruel: fale a verdade ou morra, faça o desafio ou morra, e se parar de jogar, também morre.","first_air_date":"2018-04-12","runtime":100,"episode_run_time":[100],"vote_average":5.9,"created_by":["Blumhouse Productions"],"production_companies":[{"name":"Blumhouse Productions"}],"cast":["Lucy Hale","Violett Beane","Tyler Posey","Hayden Szeto","Aurora Perrineau"],"backdrop_path":"https://image.tmdb.org/t/p/original/eQ5xu2pQ5Kergubto5PbbUzey28.jpg","poster_path":"https://image.tmdb.org/t/p/original/oEIeZE4oBSTKjBMxQWNdGdI13a0.jpg","certification":"14","genres":["Thriller","Terror"],"trailer":"N/A"},
"310593":{"id":"310593","name":"A Juventude","slug":"a-juventude","original_title":"Youth","overview":"Fred (Michael Caine) e Mick (Harvey Keitel), dois velhos amigos com quase 80 anos de idade cada, estão passando as férias em um luxuoso hotel. Fred é um compositor e maestro aposentado e Mick é um cineasta em atividade. Juntos, os dois passam a se recordar de suas paixões da infância e juventude. Enquanto Mick luta para finalizar o roteiro daquele que ele acha que será seu último grande filme, Fred não tem a mínima vontade de voltar à música. Entretanto, muita coisa pode mudar.","first_air_date":"2015-05-20","runtime":124,"episode_run_time":[124],"vote_average":6.9,"created_by":["Indigo Film","Medusa Film","Barbary Films","Pathé","Number 9 Films","C-Films","France 2 Cinéma","Film4 Productions"],"production_companies":[{"name":"Indigo Film"},{"name":"Medusa Film"},{"name":"Barbary Films"},{"name":"Pathé"},{"name":"Number 9 Films"},{"name":"C-Films"},{"name":"France 2 Cinéma"},{"name":"Film4 Productions"}],"cast":["Michael Caine","Harvey Keitel","Rachel Weisz","Paul Dano","Jane Fonda"],"backdrop_path":"https://image.tmdb.org/t/p/original/7nFfW8RM50PANBIdfI9Ut3FdoSB.jpg","poster_path":"https://image.tmdb.org/t/p/original/crra1ak4qRXPfMoHuhQRfxlmOFD.jpg","certification":"14","genres":["Comédia","Drama"],"trailer":"N/A"},
