"1248753":{"id":"1248753","name":"Alerta Âmbar","slug":"alerta-ambar","original_title":"Amber Alert","overview":"Jaq está ansiosa para chegar ao seu primeiro dia em um novo emprego, e seu motorista, Shane, que está apenas tentando ganhar um pouco mais com seu trabalho. Um alerta de sequestro de criança em seus telefones mudará tudo isso quando descobrirem que estão atrás de um carro que corresponde à descrição do sequestrador. Incapazes de deixar escapar um possível traficante de crianças, eles iniciam uma perseguição que colocará suas próprias vidas em risco.","first_air_date":"2024-09-27","runtime":91,"episode_run_time":[91],"vote_average":7.1,"created_by":["Hungry Bull Productions","TPC","Bluefields Entertainment"],"production_companies":[{"name":"Hungry Bull Productions"},{"name":"TPC"},{"name":"Bluefields Entertainment"}],"cast":["Hayden Panettiere","Tyler James Williams","Kevin Dunn","Saidah Arrika Ekulona","Kurt Oberhaus"],"backdrop_path":"https://image.tmdb.org/t/p/original/vt37v6ouquokPYeEg3xqkzKjHRj.jpg","poster_path":"https://image.tmdb.org/t/p/original/3fTxejhAJeMyzNgVJvWgisWrrqr.jpg","certification":"N/A","genres":["Thriller","Drama"],"trailer":"7kUrob8m1Lc"},
