"306819":{"id":"306819","name":"A Garota Dinamarquesa","slug":"a-garota-dinamarquesa","original_title":"The Danish Girl","overview":"Na Copenhague de 1926, os artistas Einar e Gerda Wegener se casam. Gerda então decide vestir Einar de mulher para pintá-lo. Einar começa a mudar sua aparência, transformando-se em uma mulher, e passa a se chamar de Lili Elbe. Com o apoio, ainda que conturbado, da esposa, um Einar deprimido passa por uma das primeiras cirurgias de mudança de sexo da história para tentar se transformar por completo em Lili e recuperar o gosto pela vida.","first_air_date":"2015-11-27","runtime":119,"episode_run_time":[119],"vote_average":7.6,"created_by":["Pretty Pictures","Working Title Films","Artémis Productions","Shelter Productions","Senator Global Productions","ReVision Pictures","Working Title Films"],"production_companies":[{"name":"Pretty Pictures"},{"name":"Working Title Films"},{"name":"Artémis Productions"},{"name":"Shelter Productions"},{"name":"Senator Global Productions"},{"name":"ReVision Pictures"},{"name":"Working Title Films"}],"cast":["Eddie Redmayne","Alicia Vikander","Matthias Schoenaerts","Ben Whishaw","Sebastian Koch"],"backdrop_path":"https://image.tmdb.org/t/p/original/hHvvGvodFPADcbn0svgmSBYM9TU.jpg","poster_path":"https://image.tmdb.org/t/p/original/656mtTYVaon6VFQzRz0nBcEdbbE.jpg","certification":"14","genres":["Drama"],"trailer":"vjq2FgjpXow"},
"949567":{"id":"949567","name":"A Maldição de Hannah Stevenson","slug":"a-maldicao-de-hannah-stevenson","original_title":"The Exorcism of Hannah Stevenson","overview":"Hannah e Matt, um jovem casal em suas primeiras férias juntos, descobrem rapidamente que podem não concordar. Sentindo-se como se tivesse decepcionado o namorado, Hannah pede a ajuda de uma misteriosa cigana, na esperança de que os problemas do casal possam ser superados. No entanto, quando Matt acorda e descobre que sua namorada desapareceu, as intenções sinistras da cigana tornam-se muito claras.","first_air_date":"2022-03-14","runtime":75,"episode_run_time":[75],"vote_average":5.7,"created_by":[],"production_companies":[],"cast":["Hannah Rose","Tom Hogan","Edward Gist","Howard Lewis Morgan","Charlie Downes"],"backdrop_path":"https://image.tmdb.org/t/p/original/iKVkmyDKUHOS7r0fkF7sWLArCsv.jpg","poster_path":"https://image.tmdb.org/t/p/original/uCOMiPwygEPSuUjatADcLMDoRnL.jpg","certification":"N/A","genres":["Fantasia","Terror"],"trailer":"N/A"},
"55846":{"id":"55846","name":"Blitz","slug":"blitz","original_title":"Blitz","overview":"O sargento Brant não anda em um bom momento. Em julgamento por ter agredido um psicólogo policial, ele ainda precisa lidar com o abandono do esquadrão em que trabalha. Além disto a esposa do inspetor-chefe morreu em um acidente de carro e a policial Falls fica no seu pé o tempo todo na tentativa de conseguir uma vaga na equipe. Em meio a este turbilhão, Brant precisa lidar com Blitz, um serial killer que tem como alvo policiais que fazem batidas pela cidade.","first_air_date":"2011-05-20","runtime":97,"episode_run_time":[97],"vote_average":6.2,"created_by":["Lipsync Productions","Kushner/Wyman Productions","Davis Films","Lionsgate","Current Entertainment"],"production_companies":[{"name":"Lipsync Productions"},{"name":"Kushner/Wyman Productions"},{"name":"Davis Films"},{"name":"Lionsgate"},{"name":"Current Entertainment"}],"cast":["Jason Statham","Paddy Considine","Aidan Gillen","Zawe Ashton","Luke Evans"],"backdrop_path":"https://image.tmdb.org/t/p/original/cEZLw8ShCEbgaGqqh6kGDZm7y4K.jpg","poster_path":"https://image.tmdb.org/t/p/original/qjqmhhc7uLub22mhu4V6DjOBwXM.jpg","certification":"N/A","genres":["Crime","Ação","Thriller"],"trailer":"N/A"},
"1725":{"id":"1725","name":"Amor, Sublime Amor","slug":"amor-sublime-amor","original_title":"West Side Story","overview":"No lado oeste de Nova York, à sombra dos arranha-céus, ficam os guetos de imigrantes e classes menos favorecidas. Duas gangues, os Sharks, de porto-riquenhos, e os Jets, de brancos de origem anglo-saxônica, disputam a área, seguindo um código próprio de guerra e honra. Tony (Richard Beymer), antigo líder dos Jets, se apaixona por Maria (Natalie Wood), irmã do líder dos Sharks, e tem seu amor correspondido. A paixão dos dois fere princípios em ambos os lados, acirrando ainda mais a disputa.","first_air_date":"1961-12-13","runtime":152,"episode_run_time":[152],"vote_average":7.3,"created_by":["Seven Arts Productions","The Mirisch Company","United Artists"],"production_companies":[{"name":"Seven Arts Productions"},{"name":"The Mirisch Company"},{"name":"United Artists"}],"cast":["Natalie Wood","Richard Beymer","Russ Tamblyn","Rita Moreno","George Chakiris"],"backdrop_path":"https://image.tmdb.org/t/p/original/swYJtp5GISfsCMZ46y2WNBBwJsq.jpg","poster_path":"https://image.tmdb.org/t/p/original/pGSWoKvUFhPHI3AkOUczJr91t9q.jpg","certification":"L","genres":["Crime","Drama","Romance"],"trailer":"N/A"},
"9090":{"id":"9090","name":"Para Wong Foo, Obrigada por Tudo! Julie Newmar","slug":"para-wong-foo-obrigada-por-tudo-julie-newmar","original_title":"To Wong Foo, Thanks for Everything! Julie Newmar","overview":"Três drag queens viajam pelo interior dos Estados Unidos, quando o carro em que estão quebra e elas ficam encalhadas numa cidadezinha onde nada acontece. Ou acontecia... As três tiram proveito da situação e usam o glamour para chacoalhar os moradores com um palco montado para um fim de semana de alegria e simplicidade.","first_air_date":"1995-09-07","runtime":109,"episode_run_time":[109],"vote_average":7.4,"created_by":["Amblin Entertainment","Universal Pictures"],"production_companies":[{"name":"Amblin Entertainment"},{"name":"Universal Pictures"}],"cast":["Patrick Swayze","Wesley Snipes","John Leguizamo","Stockard Channing","Blythe Danner"],"backdrop_path":"https://image.tmdb.org/t/p/original/xga9dXEIJHAjNLGMjw4VDPH7LJB.jpg","poster_path":"https://image.tmdb.org/t/p/original/e5hCXMXM0ZLK1tjJaeIFtEBNFot.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
"698":{"id":"698","name":"007 Contra o Foguete da Morte","slug":"007-contra-o-foguete-da-morte","original_title":"Moonraker","overview":"Um avião carregando um foguete espacial sofre um acidente. Mas quando o Serviço Secreto Britânico vai examinar os destroços, não encontra nenhum vestígio da espaçonave. Assim, James Bond (Roger Moore) tem a missão de investigar o caso e começa indo visitar o multimilionário que construiu a aeronave e tem idéias bastantes estranhas de qual deva ser o destino da raça humana.","first_air_date":"1979-06-26","runtime":126,"episode_run_time":[126],"vote_average":6.2,"created_by":["EON Productions","Les Productions Artistes Associés","United Artists"],"production_companies":[{"name":"EON Productions"},{"name":"Les Productions Artistes Associés"},{"name":"United Artists"}],"cast":["Roger Moore","Lois Chiles","Michael Lonsdale","Richard Kiel","Corinne Cléry"],"backdrop_path":"https://image.tmdb.org/t/p/original/mrDC5DLx2wljt4HZGwgkmqlzfcF.jpg","poster_path":"https://image.tmdb.org/t/p/original/qLWSt8edXmWG55I16DJt5VtXsR3.jpg","certification":"12","genres":["Ação","Aventura","Thriller","Ficção científica"],"trailer":"N/A"},
