"11469":{"id":"11469","name":"Loucuras na Idade Média","slug":"loucuras-na-idade-media","original_title":"Black Knight","overview":"Jamal Sky Walker (Martin Lawrence) é um homem tagarela que tem grandes planos para sua vida. Mas, no momento, ele precisa se concentrar em seu trabalho em um parque temático sobre a Idade Média. Entretanto, num dia Jamal leva uma bolada na cabeça e desmaia. Ao acordar, percebe que está em pleno ano 1328, em um mundo repleto de cavaleiros em suas armaduras e donzelas a serem salvas. Jamal então resolve ajudar um ex-cavaleiro e uma bela camponesa contra um rei malvado, usando para isso seus conhecimentos do século 21 em plena Idade Média.","first_air_date":"2001-11-21","runtime":95,"episode_run_time":[95],"vote_average":5.4,"created_by":["Epsilon Motion Pictures","Regency Enterprises","New Regency Pictures","Runteldat Entertainment","Firm, The","20th Century Fox"],"production_companies":[{"name":"Epsilon Motion Pictures"},{"name":"Regency Enterprises"},{"name":"New Regency Pictures"},{"name":"Runteldat Entertainment"},{"name":"Firm, The"},{"name":"20th Century Fox"}],"cast":["Martin Lawrence","Marsha Thomason","Tom Wilkinson","Jeannette Weegar","Vincent Regan"],"backdrop_path":"https://image.tmdb.org/t/p/original/udgq4FDqsRgJIACUrWlk1BRtUhf.jpg","poster_path":"https://image.tmdb.org/t/p/original/Aibgm0dWaFWTE6XMpF4hQ4tjWcV.jpg","certification":"N/A","genres":["Comédia","Fantasia","Aventura"],"trailer":"N/A"},
