"824":{"id":"824","name":"Moulin Rouge: Amor em Vermelho","slug":"moulin-rouge-amor-em-vermelho","original_title":"Moulin Rouge!","overview":"Christian é um jovem escritor que possui um dom para a poesia e que enfrenta seu pai para poder se mudar para o bairro boêmio de Montmartre, em Paris. Lá ele recebe o apoio de Henri de Toulouse-Latrec, que o ajuda a participar da vida social e cultural do local, que gira em torno do Moulin Rouge, uma boate que possui um mundo próprio de sexo, drogas, adrenalina e Can-Can. Ao visitar o local, Christian logo se apaixona por Satine, a mais bela cortesã de Paris e estrela maior do Moulin Rouge.","first_air_date":"2001-05-18","runtime":128,"episode_run_time":[128],"vote_average":7.5,"created_by":["20th Century Fox","Bazmark"],"production_companies":[{"name":"20th Century Fox"},{"name":"Bazmark"}],"cast":["Nicole Kidman","Ewan McGregor","John Leguizamo","Jim Broadbent","Richard Roxburgh"],"backdrop_path":"https://image.tmdb.org/t/p/original/xDVRvyJaKjsTrptaKYkwGSZSZUC.jpg","poster_path":"https://image.tmdb.org/t/p/original/4GQusiDtkDNFWG5mBNGpFGYQLGd.jpg","certification":"12","genres":["Drama","Romance","Música"],"trailer":"N/A"},
