"433502":{"id":"433502","name":"Consequências","slug":"consequencias","original_title":"The Aftermath","overview":"Recém-chegada em Hamburgo, Rachel Morgan é afetada de imediato pelo clima sombrio que a cidade conserva depois de ter sido inteiramente destruída durante a Segunda Guerra Mundial. Seu marido, o coronel britânico Lewis , foi encarregado de coordenar a reconstrução da região por tempo indeterminado. Em uma decisão unilateral, Lewis estabelece que o casal ficará hospedado na casa de um viúvo alemão, provocando sentimentos conflituosos em sua esposa.","first_air_date":"2019-03-01","runtime":108,"episode_run_time":[108],"vote_average":6.4,"created_by":["Scott Free Productions","Amusement Park Films","Fox Searchlight Pictures"],"production_companies":[{"name":"Scott Free Productions"},{"name":"Amusement Park Films"},{"name":"Fox Searchlight Pictures"}],"cast":["Keira Knightley","Alexander Skarsgård","Jason Clarke","Martin Compston","Kate Phillips"],"backdrop_path":"https://image.tmdb.org/t/p/original/nj15gARebe1AFDb6rRqqllNfNlr.jpg","poster_path":"https://image.tmdb.org/t/p/original/p3j8GWWWS04N5eoKHeyDsTjbqp1.jpg","certification":"12","genres":["Guerra","Drama","Romance"],"trailer":"N/A"},
"9909":{"id":"9909","name":"Mentes Perigosas","slug":"mentes-perigosas","original_title":"Dangerous Minds","overview":"Louanne Johnson, uma oficial da marinha, abandona a vida militar para ser professora de inglês. Porém, logo na primeira escola em que trabalha, ela se depara com diversas barreiras e é forçada a lidar com a rebeldia dos alunos. Como a professora não consegue a atenção da sua classe, ela parte para outra forma de ensino e passa a dar aulas com caratê e músicas de Bob Dylan, tentando ajudar a turma por meio de métodos pouco convencionais.","first_air_date":"1995-08-11","runtime":99,"episode_run_time":[99],"vote_average":7.0,"created_by":["Don Simpson/Jerry Bruckheimer Films","Hollywood Pictures","Via Rosa Productions"],"production_companies":[{"name":"Don Simpson/Jerry Bruckheimer Films"},{"name":"Hollywood Pictures"},{"name":"Via Rosa Productions"}],"cast":["Michelle Pfeiffer","George Dzundza","Courtney B. Vance","Robin Bartlett","Beatrice Winde"],"backdrop_path":"https://image.tmdb.org/t/p/original/k28lTv01nuncbs9Y2WZh6FQunqv.jpg","poster_path":"https://image.tmdb.org/t/p/original/gGejznMDy26IF0El7xMMqQv9ewu.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"77866":{"id":"77866","name":"Contrabando","slug":"contrabando","original_title":"Contraband","overview":"Chris Farraday (Mark Wahlberg) já tinha largado a vida de contrabandista, mas Andy (Caleb Jones), o irmão de sua esposa Kate (Kate Beckinsale), se meteu numa jogada e perdeu a mercadoria. Agora, ele precisa voltar à ativa para recuperar o prejuízo porque Tim Briggs (Giovanni Ribisi) e seus capangas, começam a ameaçar sua esposa e a família. Começa então um forte pressão e Chris vai precisar de toda a sua experiência e contatos para vencer essa corrida contra o relógio e pagar uma dívida de milhões de dólares.","first_air_date":"2012-01-12","runtime":109,"episode_run_time":[109],"vote_average":6.3,"created_by":["Universal Pictures","Relativity Media","Working Title Films","BlueEyes Productions","Leverage Entertainment","Closest to the Hole Productions","Farraday Films"],"production_companies":[{"name":"Universal Pictures"},{"name":"Relativity Media"},{"name":"Working Title Films"},{"name":"BlueEyes Productions"},{"name":"Leverage Entertainment"},{"name":"Closest to the Hole Productions"},{"name":"Farraday Films"}],"cast":["Mark Wahlberg","Kate Beckinsale","Ben Foster","Giovanni Ribisi","Lukas Haas"],"backdrop_path":"https://image.tmdb.org/t/p/original/3se6YngJYOQ8rpbp7ZeNcnSKmmM.jpg","poster_path":"https://image.tmdb.org/t/p/original/bk39VBQJC1fPoN33wBeAtziYa0h.jpg","certification":"16","genres":["Thriller","Ação","Drama","Crime"],"trailer":"N/A"},
