"6280":{"id":"6280","name":"Junior","slug":"junior","original_title":"Junior","overview":"Dois pesquisadores, o grandalhão Dr. Hasse (Arnold Schwarzenegger) e o pequeno e malandro Dr. Arbogast (Danny DeVito), desenvolvem uma droga para auxiliar a gravidez. Impedidos de continuar o projeto, a dupla rouba um óvulo e o implanta na barriga do Dr. Hasse. E assim passam a testar a droga, a partir das reações do grandalhão durante os 9 meses de gestação.","first_air_date":"1994-11-22","runtime":109,"episode_run_time":[109],"vote_average":5.2,"created_by":["Northern Lights Entertainment","Universal Pictures"],"production_companies":[{"name":"Northern Lights Entertainment"},{"name":"Universal Pictures"}],"cast":["Arnold Schwarzenegger","Danny DeVito","Emma Thompson","Frank Langella","Pamela Reed"],"backdrop_path":"https://image.tmdb.org/t/p/original/sK1IMe4yNH5Je1PBmcgw7aFA8HB.jpg","poster_path":"https://image.tmdb.org/t/p/original/fKVUEtfWoX7RMlwxC6EOaXUk9KM.jpg","certification":"14","genres":["Comédia","Ficção científica"],"trailer":"N/A"},
