"407436":{"id":"407436","name":"Mogli: Entre Dois Mundos","slug":"mogli-entre-dois-mundos","original_title":"Mowgli: Legend of the Jungle","overview":"Criado por uma alcatéia em meio às florestas da Índia, Mogli (Rohan Chand) vive com os animais da selva e conta com a amizade do urso Baloo (Andy Serkis) e da pantera Bagheera (Christian Bale). Ele é aceito por todos os animais, exceto pelo temido tigre Shere Khan (Benedict Cumberbach). Quando Mogli se defronta com suas origens humanas, perigos maiores do que a rixa com Shere Khan podem surgir.","first_air_date":"2018-11-25","runtime":105,"episode_run_time":[105],"vote_average":6.5,"created_by":["The Imaginarium","Warner Bros. Pictures"],"production_companies":[{"name":"The Imaginarium"},{"name":"Warner Bros. Pictures"}],"cast":["Rohan Chand","Christian Bale","Cate Blanchett","Benedict Cumberbatch","Naomie Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/pApaVlxJCp2o4mrzCAD3AaLjq77.jpg","poster_path":"https://image.tmdb.org/t/p/original/9j7VmIA7SB6aDmEpy055jq8ClJe.jpg","certification":"12","genres":["Aventura","Drama"],"trailer":"fXE1Vv0-PJQ"},
