"10028":{"id":"10028","name":"Honey: No Ritmo dos Seus Sonhos","slug":"honey-no-ritmo-dos-seus-sonhos","original_title":"Honey","overview":"Nova York. Honey Daniels (Jessica Alba) é uma sexy dançarina de hip-hop que sonha se tornar uma coreógrafa de videoclips. Ela ensina hip-hop para jovens da sua localidade e os encoraja a ficarem longe das ruas, para evitarem problemas. Um diretor de clipes, Michael Ellis (David Moscow), a vê dançando numa discoteca e a convida para participar de um clip. Ela é encorajada a deixar de ser dançarina e se tornar coreógrafa, mas o sucesso repentino de Honey tem um preço quando Michael se recusa a aceitar um não como resposta para sua tentativa de tentar seduzi-la. Assim ele tenta sabotar a carreira de Honey, para tirá-la do ramo definitivamente.","first_air_date":"2003-11-24","runtime":96,"episode_run_time":[96],"vote_average":6.3,"created_by":["NuAmerica Entertainment","Universal Pictures","Marc Platt Productions"],"production_companies":[{"name":"NuAmerica Entertainment"},{"name":"Universal Pictures"},{"name":"Marc Platt Productions"}],"cast":["Jessica Alba","Mekhi Phifer","Romeo","Joy Bryant","David Moscow"],"backdrop_path":"https://image.tmdb.org/t/p/original/9dixOiaWMKAJiqBiIf7GgHADsG4.jpg","poster_path":"https://image.tmdb.org/t/p/original/ddCai1y3C6eX9vsa9eIZdJ4f0lm.jpg","certification":"N/A","genres":["Música","Drama","Romance"],"trailer":"cTaSJWqNvJ4"},
