"7303":{"id":"7303","name":"Encontro de Amor","slug":"encontro-de-amor","original_title":"Maid in Manhattan","overview":"Marisa Ventura é uma batalhadora mãe solteira que trabalha em um chiquérrimo hotel em Manhattan e sonha com uma vida melhor para ela e seu filho. Num inesperado dia, o cliente do hotel e candidato a senador Christopher Marshall conhece Marisa e a confunde com uma socialite rica. Depois de passarem uma agradável tarde juntos, os dois se apaixonam. Mas quando a verdadeira identidade de Marisa é revelada, a diferença de classes acaba separando o casal. Será possível duas pessoas de classes diferentes vencerem as dificuldades e viverem felizes para sempre?","first_air_date":"2002-12-13","runtime":105,"episode_run_time":[105],"vote_average":6.1,"created_by":["Red Om Films"],"production_companies":[{"name":"Red Om Films"}],"cast":["Jennifer Lopez","Ralph Fiennes","Natasha Richardson","Stanley Tucci","Tyler Posey"],"backdrop_path":"https://image.tmdb.org/t/p/original/l5sD0AK286fBpXyDHRCbtaFMArN.jpg","poster_path":"https://image.tmdb.org/t/p/original/4uK9nvLDNf2B9QZdaJIhWFJ60as.jpg","certification":"L","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
