"37257":{"id":"37257","name":"Testemunha de Acusação","slug":"testemunha-de-acusacao","original_title":"Witness for the Prosecution","overview":"Quando Leonard Vole (Tyrone Power) é preso sob a acusação de ter assassinado uma rica viúva de meia-idade, Sir Wilfrid Robarts (Charles Laughton), um veterano e astuto advogado, concorda em defendê-lo. Sir Wilfrid está se recuperando de um ataque do coração quase fatal e \"supostamente\" está em uma dieta, que o proíbe de ingerir bebidas alcoólicas e de se envolver em casos complicados. Mas a atração pelas cortes criminais é algo muito forte para ele, especialmente quando o caso é bem difícil. O único álibi de Vole é o testemunho da sua esposa, Christine Vole (Marlene Dietrich), uma mulher fria e calculista. A tarefa de Sir Wilfrid fica praticamente impossível quando Christine Vole concorda em ser testemunha, não da defesa, mas da acusação.","first_air_date":"1957-12-17","runtime":114,"episode_run_time":[114],"vote_average":8.2,"created_by":["Edward Small Productions"],"production_companies":[{"name":"Edward Small Productions"}],"cast":["Tyrone Power","Marlene Dietrich","Charles Laughton","Elsa Lanchester","John Williams"],"backdrop_path":"https://image.tmdb.org/t/p/original/rVreHs57dd8xonPeLlqXdHmYq4M.jpg","poster_path":"https://image.tmdb.org/t/p/original/x19FjKz45i3Fwlj6wGZUBHUAR1y.jpg","certification":"12","genres":["Drama","Mistério","Crime"],"trailer":"N/A"},
