"409":{"id":"409","name":"O Paciente Inglês","slug":"o-paciente-ingles","original_title":"The English Patient","overview":"No final da Segunda Guerra Mundial, um desconhecido (Ralph Fiennes) que teve queimaduras generalizadas quando seu avião foi abatido e é conhecido apenas como o paciente inglês acaba recebendo os cuidados de uma enfermeira canadense (Juliette Binoche). Gradativamente ele começa a narrar o grande envolvimento que teve com a mulher (Kristin Scott Thomas) do seu melhor amigo (Colin Firth) e de como este amor foi fortemente correspondido. Mas da mesma forma que determinadas lembranças lhe surgem na mente, outros detalhes parecem não vir a lembrança, como se ele quisesse que tais fatos continuassem enterrados e esquecidos.","first_air_date":"1996-11-14","runtime":162,"episode_run_time":[162],"vote_average":7.2,"created_by":["Miramax","The Saul Zaentz Company","Tiger Moth Productions"],"production_companies":[{"name":"Miramax"},{"name":"The Saul Zaentz Company"},{"name":"Tiger Moth Productions"}],"cast":["Ralph Fiennes","Juliette Binoche","Willem Dafoe","Kristin Scott Thomas","Naveen Andrews"],"backdrop_path":"https://image.tmdb.org/t/p/original/em5kAUF8QbwThG5BCqVgFomxNT5.jpg","poster_path":"https://image.tmdb.org/t/p/original/trghWXTIg3vXJ4NgYvjSNvr0vqk.jpg","certification":"16","genres":["Drama","Romance","Guerra"],"trailer":"N/A"},
"23047":{"id":"23047","name":"Caça às Bruxas","slug":"caca-as-bruxas","original_title":"Season of the Witch","overview":"Behmen (Nicolas Cage) lutou por vários anos nas Cruzadas, perdeu batalhas, amigos e também a fé. Ao desistir de ajudar a Igreja em sua luta pelo poder, ele só encontra devastação, fome e a peste negra. Ao lado de seu fiel escudeiro Felton (Ron Perlman), ele torna-se inimigo dos governantes, mas acaba recebendo uma missão que pode liquidar seus débitos: levar uma jovem, suspeita de ser uma bruxa, para um monastério distante. Mas o caminho será bastante tortuoso e mesmo antes de chegar ao destino, eles descobrirão que estão diante de forças sobrenaturais e que o mal está além de toda e qualquer compreensão.","first_air_date":"2011-01-07","runtime":95,"episode_run_time":[95],"vote_average":5.5,"created_by":["Atlas Entertainment","Relativity Media","Mandate International","Rogue Pictures"],"production_companies":[{"name":"Atlas Entertainment"},{"name":"Relativity Media"},{"name":"Mandate International"},{"name":"Rogue Pictures"}],"cast":["Nicolas Cage","Ron Perlman","Ulrich Thomsen","Christopher Lee","Fernanda Dorogi"],"backdrop_path":"https://image.tmdb.org/t/p/original/9Lm94WVtV4HPxr7NWNlwkhLKSeH.jpg","poster_path":"https://image.tmdb.org/t/p/original/oNyEYVm295JdZXbRi40XcqjOs7G.jpg","certification":"N/A","genres":["Aventura","Fantasia","Ação"],"trailer":"N/A"},
