"192145":{"id":"192145","name":"Terceira Pessoa","slug":"terceira-pessoa","original_title":"Third Person","overview":"O filme conta três histórias de amor diferentes: Michael (Liam Neeson) é um escritor veterano, que acaba de romper com a esposa (Kim Basinger) e viaja a Paris, buscando novas histórias. Ele encontra na aspirante a escritora Anna (Olivia Wilde) uma amante e uma inspiração, devido ao passado sombrio da garota. O empresário Scott (Adrien Brody) está passeando por Roma, quando conhece a misteriosa cigana Monica (Moran Atias) e simpatiza com sua perigosa busca para reencontrar a filha pequena. Julia (Mila Kunis) é uma jovem mãe, traumatizada após perder a guarda do filho para o ex-marido famoso (James Franco), e conta com a ajuda da advogada Theresa (Maria Bello) nesta batalha judicial.","first_air_date":"2014-06-20","runtime":137,"episode_run_time":[137],"vote_average":5.9,"created_by":["Corsan","Hwy61","Volten","Lailaps Pictures","Filmfinance XII","Apulia Film Commission"],"production_companies":[{"name":"Corsan"},{"name":"Hwy61"},{"name":"Volten"},{"name":"Lailaps Pictures"},{"name":"Filmfinance XII"},{"name":"Apulia Film Commission"}],"cast":["Liam Neeson","Mila Kunis","Adrien Brody","James Franco","Olivia Wilde"],"backdrop_path":"https://image.tmdb.org/t/p/original/sKnbKlgMDCTDTtKm91wJ4vSbyIH.jpg","poster_path":"https://image.tmdb.org/t/p/original/qA6ierafwpHJiOrisGLK6hZfkGs.jpg","certification":"14","genres":["Drama","Romance"],"trailer":"N/A"},
