"7299":{"id":"7299","name":"Equilibrium","slug":"equilibrium","original_title":"Equilibrium","overview":"Na nação Líbria há sempre paz entre os homens. O sistema é simples: neste mundo futurista um regime severo e rigoroso eliminou a guerra suprimindo todas as emoções. Ler livros, ouvir música e ver quadros é um crime punível inclusive com a pena de morte. Quem é feliz é preso, e quem chora, perseguido. E quem não tomar a dose diária de Prozium, uma droga distribuída pelo Estado que altera a mente e restringe as emoções, assina imediatamente a sua sentença de morte. Clerick John Preston é um alto dignatário governamental responsável por destruir quem não cumpre as regras. Mas no dia em que se esquece de tomar a sua dose, descobre que ele é afinal a única pessoa capaz de destruir o regime que o treinou para fazer cumprir as suas rígidas leis.","first_air_date":"2002-12-06","runtime":107,"episode_run_time":[107],"vote_average":7.0,"created_by":["Blue Tulip Productions","Dimension Films"],"production_companies":[{"name":"Blue Tulip Productions"},{"name":"Dimension Films"}],"cast":["Christian Bale","Taye Diggs","Angus Macfadyen","Matthew Harbour","Sean Bean"],"backdrop_path":"https://image.tmdb.org/t/p/original/huZZBPyYUnMPCnrAFyJhnwYsQx9.jpg","poster_path":"https://image.tmdb.org/t/p/original/rHXNrxpi1hx39zy4nNz0tX9eeD0.jpg","certification":"16","genres":["Ação","Ficção científica","Thriller"],"trailer":"N/A"},
