"44639":{"id":"44639","name":"Trabalho Interno","slug":"trabalho-interno","original_title":"Inside Job","overview":"A crise financeira mundial que aconteceu em 2008, causou a perda de milhões de empregos e casas e mergulhou os Estados Unidos em uma profunda recessão econômica. Matt Damon narra um documentário que fornece uma análise detalhada dos elementos que levaram ao colapso e identifica peças-chave do mundo financeiro e político. O diretor Charles Ferguson realiza uma gama de entrevistas e traça a história dos Estados Unidos para a China para a Islândia e para outros mercados financeiros mundiais.","first_air_date":"2010-10-08","runtime":105,"episode_run_time":[105],"vote_average":7.7,"created_by":["Sony Pictures"],"production_companies":[{"name":"Sony Pictures"}],"cast":["Matt Damon","William Ackman","Barack Obama","George W. Bush","Jonathan Alpert"],"backdrop_path":"https://image.tmdb.org/t/p/original/1yFmxvVYgVrFKL2ksFzgX0MrWOM.jpg","poster_path":"https://image.tmdb.org/t/p/original/7O7DBUqbD1z7lhjC9VP95scA1Dt.jpg","certification":"12","genres":["Documentário","Crime"],"trailer":"N/A"},
