"41402":{"id":"41402","name":"Deixe-me Entrar","slug":"deixe-me-entrar","original_title":"Let Me In","overview":"Owen é um garoto solitário, que vive com a mãe e é sempre provocado pelos valentões da escola. Um dia ele conhece, perto de sua casa, Abby. Sempre nas sombras, ela aos poucos de aproxima de Owen e logo se tornam amigos. Só que Abby possui um segredo: ela é muito mais velha que sua aparência indica e necessita de sangue para sobreviver. Para consegui-lo, seu acompanhante realiza assassinatos na surdina, de forma a retirar o sangue das vítimas e levá-lo para Abby.","first_air_date":"2010-10-01","runtime":116,"episode_run_time":[116],"vote_average":6.8,"created_by":["Hammer Film Productions","EFTI","Overture Films","Exclusive Media"],"production_companies":[{"name":"Hammer Film Productions"},{"name":"EFTI"},{"name":"Overture Films"},{"name":"Exclusive Media"}],"cast":["Kodi Smit-McPhee","Chloë Grace Moretz","Richard Jenkins","Elias Koteas","Sasha Barrese"],"backdrop_path":"https://image.tmdb.org/t/p/original/fevLYz1pbbchb3hGslEyhoQPWMH.jpg","poster_path":"https://image.tmdb.org/t/p/original/nLtskZmHPLRVRazLGXS7DWY5wtN.jpg","certification":"16","genres":["Drama","Terror","Mistério"],"trailer":"N/A"},
