"1107387":{"id":"1107387","name":"Hachiko Para Sempre","slug":"hachiko-para-sempre","original_title":"忠犬八公","overview":"A produção traz uma adaptação do roteiro original de “Hachiko Monogatari”, que apresenta a história de um cachorro da raça Akita Inu, que mesmo depois da morte de seu dono continuou a esperá-lo por dez anos na estação de trem de Shibuya, em Tóquio. No longa, um professor encontra um filhote abandonado em uma cidade distante e desabitada e decide adotá-lo. A dupla cria um forte laço de amizade e afeto a ponto do cão acompanhar seu dono até a estação todos os dias. No entanto, quando o professor morre, o companheiro passa a esperá-lo no mesmo lugar apesar da família decidir deixar a cidade.","first_air_date":"2023-03-31","runtime":124,"episode_run_time":[124],"vote_average":7.9,"created_by":["iQIYI Pictures","Beijing Lajin Film"],"production_companies":[{"name":"iQIYI Pictures"},{"name":"Beijing Lajin Film"}],"cast":["冯小刚","Joan Chen","白举纲","Huang Chutong","钱波"],"backdrop_path":"https://image.tmdb.org/t/p/original/sptxlzXJA1t1oWrtAv3t88cKkB2.jpg","poster_path":"https://image.tmdb.org/t/p/original/w5GeWMEEWJBMKXSeDB5BpcowEBn.jpg","certification":"L","genres":["Drama","Família"],"trailer":"Sc1-vKwoH4Q"},
"806":{"id":"806","name":"A Profecia","slug":"a-profecia","original_title":"The Omen","overview":"Robert Thorn (Liev Schreiber) é um diplomata, que está prestes a ter um filho com sua esposa Katherine (Julia Stiles). Porém a criança morre logo após o parto, o que faz com que Robert adote um bebê para colocá-lo no lugar do filho, sem que Katherine soubesse. Seis anos depois Damien (Seamus Davey-Fitzpatrick), o filho de Robert e Katherine, começa a dar sinais de que seja o Anti-Cristo.","first_air_date":"2006-06-06","runtime":110,"episode_run_time":[110],"vote_average":5.6,"created_by":["20th Century Fox"],"production_companies":[{"name":"20th Century Fox"}],"cast":["Liev Schreiber","Julia Stiles","Mia Farrow","David Thewlis","Pete Postlethwaite"],"backdrop_path":"https://image.tmdb.org/t/p/original/oJOytnASxnwK61PD7Wyu9Gc2ihq.jpg","poster_path":"https://image.tmdb.org/t/p/original/rN61lR87sthJKEewINVfijPLp04.jpg","certification":"16","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
"23742":{"id":"23742","name":"Tiras em Apuros","slug":"tiras-em-apuros","original_title":"Cop Out","overview":"Os policiais Jimmy Monroe e Paul Hodges têm que usar suas armas na troca de tiros com um matador. Eles concordam em contar até três e abrir fogo. Mas espere, quer dizer \"1, 2 e atiram\" ou \"1, 2, 3 e aí atiram\"? Os socos doem a valer, mas seu estomago vai doer mesmo de tanto rir (ou existe outra possibilidade?) quando o astro Bruce Willis e o comediante Tracy Morgan somam forças para atuar como uma dupla de policiais parceiros nada comum. Kevin Smith conduz esses longos braços da lei na investigação sobre um cartão de baseball raro roubado (Jimmy precisa bancar o casamento de sua filha), uma caçada que os colocará frente a frente com o perigoso submundo das drogas. Mas esses tiras sabem muito bem o que fazer quando estão em apuros!","first_air_date":"2010-02-26","runtime":107,"episode_run_time":[107],"vote_average":5.5,"created_by":["Marc Platt Productions"],"production_companies":[{"name":"Marc Platt Productions"}],"cast":["Bruce Willis","Tracy Morgan","Seann William Scott","Ana de la Reguera","Adam Brody"],"backdrop_path":"https://image.tmdb.org/t/p/original/p8ah01N83pfwrSmlJsUufEx5pGR.jpg","poster_path":"https://image.tmdb.org/t/p/original/kRfrmgDBHpFmNszpaDTXh0HFMLZ.jpg","certification":"N/A","genres":["Ação","Comédia","Crime"],"trailer":"WOFtUDGG1ac"},
"1965":{"id":"1965","name":"Um Crime Perfeito","slug":"um-crime-perfeito","original_title":"A Perfect Murder","overview":"Emily, dona de uma fortuna de 100 milhões de dólares, é casada com Steven, um homem de negócios que atravessa uma grave crise financeira e está à beira da ruína. Emily mantém um caso extraconjugal com David, um pintor conhecido do casal. Steven visita David e lhe diz que sabe da ligação entre os dois e oferece ao pintor 500 mil dólares para matar Emily, fazendo com que pareça um acidente. David concorda em fazer o serviço.","first_air_date":"1998-06-05","runtime":107,"episode_run_time":[107],"vote_average":6.5,"created_by":["Kopelson Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"Kopelson Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Michael Douglas","Gwyneth Paltrow","Viggo Mortensen","David Suchet","Sarita Choudhury"],"backdrop_path":"https://image.tmdb.org/t/p/original/q3ND5eHCkwzbx7xL0inrSJko0PL.jpg","poster_path":"https://image.tmdb.org/t/p/original/ApRA7voSckh664rEiPhmHAYpZ3r.jpg","certification":"16","genres":["Crime","Thriller","Drama"],"trailer":"N/A"},
