"10357":{"id":"10357","name":"Volcano - A Fúria","slug":"volcano-a-furia","original_title":"Volcano","overview":"Em Los Angeles surge um desconhecido vulcão ativo, causando grande destruição e criando um rio de lava que atravessa as ruas, aniquilando tudo que surge no seu caminho. Assim, se decide se criar uma barreira que desvie a lava para o mar, antes que mais pessoas sejam mortas.","first_air_date":"1997-04-25","runtime":104,"episode_run_time":[104],"vote_average":5.9,"created_by":["20th Century Fox","Fox 2000 Pictures","Shuler Donner / Donner & Moritz Original Productions"],"production_companies":[{"name":"20th Century Fox"},{"name":"Fox 2000 Pictures"},{"name":"Shuler Donner / Donner & Moritz Original Productions"}],"cast":["Tommy Lee Jones","Anne Heche","Gaby Hoffmann","Don Cheadle","Jacqueline Kim"],"backdrop_path":"https://image.tmdb.org/t/p/original/wU7YN5jq4FKapxt9ZT20DrjQ2sm.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Azlmj0MvhXvFIqUs5Jg0AS5sA2.jpg","certification":"N/A","genres":["Ficção científica","Ação","Drama","Thriller"],"trailer":"N/A"},
"964980":{"id":"964980","name":"Air: A História Por Trás do Logo","slug":"air-a-historia-por-tras-do-logo","original_title":"Air","overview":"A história do esforço da Nike para contratar o astro do basquete em ascensão Michael Jordan para sua empresa de calçados em meados da década de 1980, um endosso que parecia impossível na época, mas que, graças ao vendedor de tênis independente Sonny Vaccarro, se tornaria o relacionamento mais significativo entre uma marca atlética e um atleta de todos os tempos.","first_air_date":"2023-04-05","runtime":114,"episode_run_time":[114],"vote_average":7.3,"created_by":["Amazon Studios","Skydance Sports","Mandalay Pictures","Artists Equity"],"production_companies":[{"name":"Amazon Studios"},{"name":"Skydance Sports"},{"name":"Mandalay Pictures"},{"name":"Artists Equity"}],"cast":["Matt Damon","Ben Affleck","Jason Bateman","Chris Messina","Viola Davis"],"backdrop_path":"https://image.tmdb.org/t/p/original/aT3sRVqgpkyCo23fp9myVfKPWbA.jpg","poster_path":"https://image.tmdb.org/t/p/original/8OGQCOp6BxwvekhZBQCzVd77Y6l.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"hIji88b4tIU"},
"10478":{"id":"10478","name":"O Jogo da Paixão","slug":"o-jogo-da-paixao","original_title":"Tin Cup","overview":"Roy McAvoy é um extraordinário jogador de golfe que teria tido uma vida profissional e particular muito boa se fizesse aquilo que a lógica manda. Mas como nunca soube controlar seus instintos vive em um pequeno lugarejo no Texas, dando aulas de golfe por uns trocados. Sua vida começa a mudar quando conhece uma psicóloga que está namorando seu antigo rival e acaba se apaixonado por ela. Após uma certa resistência por parte dela Roy acaba sendo correspondido, mas para conquistar realmente sua admiração decide participar do mais importante torneio de golfe do mundo: o U.S. Open.","first_air_date":"1996-08-16","runtime":134,"episode_run_time":[134],"vote_average":6.1,"created_by":["Regency Enterprises","Warner Bros. Pictures"],"production_companies":[{"name":"Regency Enterprises"},{"name":"Warner Bros. Pictures"}],"cast":["Kevin Costner","Rene Russo","Don Johnson","Cheech Marin","Linda Hart"],"backdrop_path":"https://image.tmdb.org/t/p/original/jiVdcXazbfOwG53QOubrUlBvtzm.jpg","poster_path":"https://image.tmdb.org/t/p/original/9EXnLLoSKOluLE60w77odBL9GJC.jpg","certification":"12","genres":["Drama","Romance","Comédia"],"trailer":"N/A"},
