"8676":{"id":"8676","name":"Um Amor de Tesouro","slug":"um-amor-de-tesouro","original_title":"Fool's Gold","overview":"Benjamin Finnegan é um caçador de tesouros obcecado em encontrar o navio Queen's Dowry, que, segundo a lenda, carregava 40 arcas de um grande tesouro. Decidido a encontrá-lo a qualquer custo, Benjamin jogou fora seu casamento com Tess, que decide então reconstruir sua vida trabalhando na equipe do bilionário Nigel Honeycutt. Um dia, Benjamin encontra uma pista fundamental em sua caça ao navio e, para desgosto de Tess, consegue convencer Nigel e sua filha Gemma a ajudá-lo em mais uma busca.","first_air_date":"2008-02-07","runtime":112,"episode_run_time":[112],"vote_average":5.8,"created_by":["De Line Pictures","Warner Bros. Pictures","Bernie Goldmann Productions"],"production_companies":[{"name":"De Line Pictures"},{"name":"Warner Bros. Pictures"},{"name":"Bernie Goldmann Productions"}],"cast":["Matthew McConaughey","Kate Hudson","Donald Sutherland","Alexis Dziena","Ewen Bremner"],"backdrop_path":"https://image.tmdb.org/t/p/original/qsTQ5H6Tf1PctCmP9Nz6vmkcN2f.jpg","poster_path":"https://image.tmdb.org/t/p/original/qx6ksOgDrMqhXCDQBoqIpeOYVHo.jpg","certification":"12","genres":["Aventura","Romance","Comédia"],"trailer":"N/A"},
