"9759":{"id":"9759","name":"Celular: Um Grito de Socorro","slug":"celular-um-grito-de-socorro","original_title":"Cellular","overview":"A professora Jessica Martin é raptada por Ethan, um bandido cruel, e levada para um esconderijo remoto, onde encontra um celular quebrado. Infelizmente, quando tenta usar o telefone para entrar em contato com as autoridades, ela acidentalmente liga para Ryan, um estudante universitário. O jovem quer ajudar Jessica, mas ela não tem ideia de onde está.","first_air_date":"2004-09-06","runtime":98,"episode_run_time":[98],"vote_average":6.4,"created_by":["Electric Entertainment"],"production_companies":[{"name":"Electric Entertainment"}],"cast":["Kim Basinger","Chris Evans","Jason Statham","William H. Macy","Noah Emmerich"],"backdrop_path":"https://image.tmdb.org/t/p/original/5KoOfHVSYvnKbCqCxJokTYlPoPP.jpg","poster_path":"https://image.tmdb.org/t/p/original/dGuEWEfHJydS4AfkcfPLDVADYI0.jpg","certification":"14","genres":["Ação","Thriller","Drama","Crime"],"trailer":"N/A"},
