"1051":{"id":"1051","name":"Operação França","slug":"operacao-franca","original_title":"The French Connection","overview":"Jimmy Doyle e Buddy Russo são dois policiais de Nova York que estão no encalço de uma quadrilha de tráfico de drogas. O primeiro, que confia no olfato, suspeita que uma confeitaria do Brooklyn esteja envolvida e convence seu chefe a grampear a linha telefônica. Logo depois, Doyle e seus homens seguem o dono da confeitaria, que os leva até Nicoly e Charnier, dois franceses que acabaram de chegar aos Estados Unidos.","first_air_date":"1971-10-09","runtime":104,"episode_run_time":[104],"vote_average":7.5,"created_by":["D'Antoni Productions","Schine-Moore Productions","20th Century Fox"],"production_companies":[{"name":"D'Antoni Productions"},{"name":"Schine-Moore Productions"},{"name":"20th Century Fox"}],"cast":["Gene Hackman","Fernando Rey","Roy Scheider","Tony Lo Bianco","Marcel Bozzuffi"],"backdrop_path":"https://image.tmdb.org/t/p/original/AsaW2VwcArvQmYjf2wsDjqWEn6f.jpg","poster_path":"https://image.tmdb.org/t/p/original/1fpcpWAzTYsuXEeEHEc1ZQedRLt.jpg","certification":"14","genres":["Ação","Crime","Thriller"],"trailer":"N/A"},
"8452":{"id":"8452","name":"O 6º Dia","slug":"o-6-dia","original_title":"The 6th Day","overview":"Em um futuro próximo, a clonagem de gado, peixes e até mesmo animais de estimação já fato corriqueiro. Mas clonar seres humanos um ato ilegal em todo o planeta. Pelo menos até Adam Gibson um dia chegar em casa e encontrar um clone em seu lugar. Agora, separado de sua família e jogado em um mundo que ele não compreende, Gibson precisa salvar a si mesmo para descobrir quem está por trás destes acontecimentos e recuperar sua família.","first_air_date":"2000-11-17","runtime":123,"episode_run_time":[123],"vote_average":6.0,"created_by":["Phoenix Pictures","Jon Davison Productions","Columbia Pictures"],"production_companies":[{"name":"Phoenix Pictures"},{"name":"Jon Davison Productions"},{"name":"Columbia Pictures"}],"cast":["Arnold Schwarzenegger","Michael Rapaport","Tony Goldwyn","Michael Rooker","Sarah Wynter"],"backdrop_path":"https://image.tmdb.org/t/p/original/2zY6nHPwU8mo4DzvL4c1qxXpQ3y.jpg","poster_path":"https://image.tmdb.org/t/p/original/rl0puYa84YLu7q7CILHmupljpGD.jpg","certification":"12","genres":["Ficção científica","Ação","Mistério","Drama","Thriller"],"trailer":"N/A"},
