"791177":{"id":"791177","name":"Até os Ossos","slug":"ate-os-ossos","original_title":"Bones and All","overview":"A história do primeiro amor de Maren, uma jovem mulher aprendendo a sobreviver à margem da sociedade, e do intenso Lee, um andarilho sem amarras. O casal se une numa odisseia de mil e quinhentos quilômetros por estradas, passagens ocultas e alçapões na América de Ronald Reagan, levando-os de volta aos seus passados traumáticos, e a uma reta final que vai determinar se o amor pode sobreviver às diferenças.","first_air_date":"2022-11-18","runtime":131,"episode_run_time":[131],"vote_average":7.1,"created_by":["Frenesy Film","Per Capita Productions","MeMo Films","The Apartment Pictures","3 Marys Entertainment","Tenderstories","Elafilm"],"production_companies":[{"name":"Frenesy Film"},{"name":"Per Capita Productions"},{"name":"MeMo Films"},{"name":"The Apartment Pictures"},{"name":"3 Marys Entertainment"},{"name":"Tenderstories"},{"name":"Elafilm"}],"cast":["Taylor Russell","Timothée Chalamet","Mark Rylance","Anna Cobb","André Holland"],"backdrop_path":"https://image.tmdb.org/t/p/original/8sPxa4sdRvjgRG3GgkO8RQxUR9P.jpg","poster_path":"https://image.tmdb.org/t/p/original/w0dCPc9J2R6wnoO9Joxz6ot703g.jpg","certification":"N/A","genres":["Drama","Terror","Romance"],"trailer":"jYquY3-wtFI"},
"112949":{"id":"112949","name":"Um Porto Seguro","slug":"um-porto-seguro","original_title":"Safe Haven","overview":"Quando uma misteriosa mulher chamada Katie (Julianne Hough) se muda para a pequena cidade de Southport, Carolina do Sul, seus novos vizinhos começam a levantar questões sobre seu passado. Bela e discreta, ela evita qualquer tipo de laço pessoal com os outros habitantes da região até que conhece o charmoso Alex (Josh Duhamel), um homem gentil, viúvo e pai de dois filhos, e a sincera Jo (Cobie Smulders), que se torna sua amiga. Katie começa a se interessar por Alex e se sente cada vez mais afeiçoada a ele e sua família. Ela acaba se apaixonando mas um segredo de seu passado a impede de ser plenamente feliz.","first_air_date":"2013-02-07","runtime":115,"episode_run_time":[115],"vote_average":7.3,"created_by":["Relativity Media","Temple Hill Entertainment"],"production_companies":[{"name":"Relativity Media"},{"name":"Temple Hill Entertainment"}],"cast":["Julianne Hough","Josh Duhamel","Cobie Smulders","David Lyons","Mimi Kirkland"],"backdrop_path":"https://image.tmdb.org/t/p/original/kUDzb7V5XuDHpY17lk8NQykiW5w.jpg","poster_path":"https://image.tmdb.org/t/p/original/gi14xLvfgZRjhKDBe5JKlOdn0QQ.jpg","certification":"12","genres":["Romance","Thriller"],"trailer":"N/A"},
