"15301":{"id":"15301","name":"No Limite da Realidade","slug":"no-limite-da-realidade","original_title":"Twilight Zone: The Movie","overview":"1959. As noites de sexta. Estamos em um tempo diferente, testemunhando reviravoltas surpreendentes, alieníginas, fobias e o medo do desconhecido. E o primeiro viajante para as regiões \"Além da Imaginação\" foi Rod Serling, criador desta memorável série de TV. Quatro mestres do cinema nos levam de volta a esse fantástico mundo, com histórias baseadas ou inspiradas em episódios clássicos: um homem intolerante recebe uma dose de seu próprio ódio; em um asilo, idosos têm a chance de experimentar um rejuvenescimento mágico; uma criança usa seus poderes para escravizar a família; a neurose de um passageiro que vê um monstro na asa do avião. Prepare-se...","first_air_date":"1983-06-24","runtime":101,"episode_run_time":[101],"vote_average":6.5,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Dan Aykroyd","Albert Brooks","Scatman Crothers","John Lithgow","Vic Morrow"],"backdrop_path":"https://image.tmdb.org/t/p/original/2ih6dOe6uTZcnYh3pIkaR3gNe91.jpg","poster_path":"https://image.tmdb.org/t/p/original/9SbVGUGx4jnJoZAVgiRCJRdBD6e.jpg","certification":"N/A","genres":["Terror","Fantasia","Ficção científica"],"trailer":"N/A"},
