"16113":{"id":"16113","name":"Comando Delta","slug":"comando-delta","original_title":"The Delta Force","overview":"Cinco anos depois de o major Scott McCoy demitir-se da Força Delta devido a questões burocráticas, ele retorna com o coronel Alexander para prender terroristas libaneses que sequestraram um Boeing 707. O líder terrorista Abdul Rifi faz de refém a tripulação e redireciona o avião para Beirute. Quando McCoy e Alexander tentam salvar os reféns, eles são forçados a combater um grupo de terroristas que é maior do que o esperado.","first_air_date":"1986-02-14","runtime":125,"episode_run_time":[125],"vote_average":5.9,"created_by":["The Cannon Group","Golan-Globus Productions"],"production_companies":[{"name":"The Cannon Group"},{"name":"Golan-Globus Productions"}],"cast":["Chuck Norris","Lee Marvin","Shelley Winters","Martin Balsam","Joey Bishop"],"backdrop_path":"https://image.tmdb.org/t/p/original/vo7lHgGCMm8mvZfjXZfDlPvYxY2.jpg","poster_path":"https://image.tmdb.org/t/p/original/A7BjrvVjnCneceCaHGG7KaR12nR.jpg","certification":"14","genres":["Ação","Thriller","Aventura","Guerra"],"trailer":"N/A"},
