"109421":{"id":"109421","name":"Terapia de Risco","slug":"terapia-de-risco","original_title":"Side Effects","overview":"A trama gira em torno da jovem Emily Hawkins (Rooney Mara), que acaba de ver o marido (Channing Tatum) ser libertado da prisão por um crime de colarinho branco. Mesmo aliviada, Emily tem crises de depressão e busca a ajuda de medicamentos prescritos para conter a ansiedade. Ela também busca amparo num tratamento psicológico, lidando com profissionais (Jude Law e Catherine Zeta-Jones). O tratamento, por mais que comece de forma positiva, vai gerar consequências inesperadas na vida da jovem.","first_air_date":"2013-02-07","runtime":106,"episode_run_time":[106],"vote_average":6.6,"created_by":["di Bonaventura Pictures","Endgame Entertainment"],"production_companies":[{"name":"di Bonaventura Pictures"},{"name":"Endgame Entertainment"}],"cast":["Rooney Mara","Jude Law","Catherine Zeta-Jones","Channing Tatum","Vinessa Shaw"],"backdrop_path":"https://image.tmdb.org/t/p/original/tqJtcqKdSh6aROWDNj9HlwkHs1u.jpg","poster_path":"https://image.tmdb.org/t/p/original/oNclZVIcoCJwaoHaiWtkiNsXybJ.jpg","certification":"14","genres":["Thriller","Crime","Drama"],"trailer":"N/A"},
