"9922":{"id":"9922","name":"O Mensageiro","slug":"o-mensageiro","original_title":"The Postman","overview":"Após uma guerra devastadora, um exército comandado aterroriza a população em uma terra sem lei. Um homem encontra um veículo dos Correios e passa a entregar correspondências atrasadas, tornando-se o Mensageiro, o qual acaba levando esperança e motivação aos sobreviventes da guerra.","first_air_date":"1997-12-25","runtime":177,"episode_run_time":[177],"vote_average":6.3,"created_by":["Tig Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Tig Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Kevin Costner","Will Patton","Larenz Tate","Olivia Williams","James Russo"],"backdrop_path":"https://image.tmdb.org/t/p/original/5mwd1quVNkdwImOF2RGm90hKZ5P.jpg","poster_path":"https://image.tmdb.org/t/p/original/hfgJx9x0mT7kI9Vy80cwL9lt8TK.jpg","certification":"N/A","genres":["Ficção científica","Aventura","Ação"],"trailer":"N/A"},
"345911":{"id":"345911","name":"Quando as Luzes Se Apagam","slug":"quando-as-luzes-se-apagam","original_title":"Lights Out","overview":"Desde que era pequena, Rebecca tinha uma porção de medos, especialmente quando as luzes se apagavam. Ela acreditava ser perseguida pela figura de uma mulher e anos mais tarde seu irmão mais novo começa a sofrer do mesmo problema. Juntos eles descobrem que a aparição está ligada à mãe deles, Rebecca começa a investigar o caso e chega perto de conhecer a terrível verdade.","first_air_date":"2016-07-21","runtime":81,"episode_run_time":[81],"vote_average":6.4,"created_by":["New Line Cinema","Atomic Monster","Grey Matter Productions","RatPac Entertainment"],"production_companies":[{"name":"New Line Cinema"},{"name":"Atomic Monster"},{"name":"Grey Matter Productions"},{"name":"RatPac Entertainment"}],"cast":["Teresa Palmer","Maria Bello","Gabriel Bateman","Alexander DiPersia","Alicia Vela-Bailey"],"backdrop_path":"https://image.tmdb.org/t/p/original/zahnSOF0U2vsbKTWqSySoUXSUgi.jpg","poster_path":"https://image.tmdb.org/t/p/original/dwcXOX4p0Wecvw3jzEe9GjlRI5Y.jpg","certification":"14","genres":["Terror"],"trailer":"akNcKdQ0n3w"},
