"318781":{"id":"318781","name":"Amor e Revolução","slug":"amor-e-revolucao","original_title":"Colonia","overview":"Chile, 1973. Em meio ao golpe de estado que derrubou o presidente eleito Salvador Allende e possibilitou a ascensão do ditador Augusto Pinochet, as massas estão nas ruas protestando, entre eles um casal alemão, Lena e Daniel. Quando o rapaz é levado pela polícia secreta de Pinochet, Lena procura por ele e descobre que seu amado está em um lugar chamado Colonia Dignidad, uma suposta missão de caridade dirigida por um pregador, só que na verdade é uma prisão de onde ninguém nunca escapou. A fim de encontrar Daniel, a moça decide se juntar ao culto religioso da Colonia.","first_air_date":"2015-06-24","runtime":106,"episode_run_time":[106],"vote_average":7.3,"created_by":["Majestic Filmproduktion","Rat Pack Filmproduktion","Iris Productions","Fred Films"],"production_companies":[{"name":"Majestic Filmproduktion"},{"name":"Rat Pack Filmproduktion"},{"name":"Iris Productions"},{"name":"Fred Films"}],"cast":["Emma Watson","Daniel Brühl","Michael Nyqvist","Richenda Carey","Vicky Krieps"],"backdrop_path":"https://image.tmdb.org/t/p/original/6gtlv8NYhzEeRyfbIbfeXp5KVJR.jpg","poster_path":"https://image.tmdb.org/t/p/original/cCRZzRIlmtg6xFPwSWQy0dFiEQs.jpg","certification":"16","genres":["Drama","História"],"trailer":"a_ovUhZAWWw"},
