"19899":{"id":"19899","name":"Encontro de Casais","slug":"encontro-de-casais","original_title":"Couples Retreat","overview":"Jason e Cynthia estão prestes a se divorciar. Como última tentativa de salvar o casamento, eles resolvem fazer uma viagem para participar de uma terapia de casais chamada \"Eden\". Para conseguir um desconto, eles incentivam seus amigos para que também viajem, no intuito de participar das atividades sem acompanhar a terapia. Inicialmente relutantes, Dave e Ronnie, Joey e Lucy, e Shane e Trudy aceitam o convite. Eles são alojados na parte oeste da ilha e Joey logo descobre que na parte leste há um resort de solteiros, proibido para casais. Decididos a aproveitar os benefícios locais, todos resolvem permanecer e fazer a tal terapia.","first_air_date":"2009-09-19","runtime":113,"episode_run_time":[113],"vote_average":5.6,"created_by":["Stuber Pictures","Universal Pictures","Relativity Media","Wild West Picture Show Productions"],"production_companies":[{"name":"Stuber Pictures"},{"name":"Universal Pictures"},{"name":"Relativity Media"},{"name":"Wild West Picture Show Productions"}],"cast":["Vince Vaughn","Jason Bateman","Jon Favreau","Faizon Love","Kristin Davis"],"backdrop_path":"https://image.tmdb.org/t/p/original/uKrfP5T5EwlR5RPGDEbFzDSaljJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/hR52K4R1eGAj2VYno6t6pCTlphA.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
