"152532":{"id":"152532","name":"Clube de Compras Dallas","slug":"clube-de-compras-dallas","original_title":"Dallas Buyers Club","overview":"Ron Woodroof, um eletricista heterossexual de Dallas, foi diagnosticado com AIDS em 1986, durante uma das épocas mais obscuras da doença. Embora os médicos tenham lhe dado apenas alguns meses de vida, Woodroof se recusou a aceitar o prognóstico e, procurando tratamentos alternativos, ele passa a contrabandear drogas ilegais do México.","first_air_date":"2013-11-01","runtime":116,"episode_run_time":[116],"vote_average":7.9,"created_by":["Truth Entertainment","Voltage Pictures","CE","Evolution Independent","R² Films","Rainmaker Films","Focus Features"],"production_companies":[{"name":"Truth Entertainment"},{"name":"Voltage Pictures"},{"name":"CE"},{"name":"Evolution Independent"},{"name":"R² Films"},{"name":"Rainmaker Films"},{"name":"Focus Features"}],"cast":["Matthew McConaughey","Jennifer Garner","Jared Leto","Denis O'Hare","Steve Zahn"],"backdrop_path":"https://image.tmdb.org/t/p/original/sbVKj98cq0FztCukzu47bu0H8o7.jpg","poster_path":"https://image.tmdb.org/t/p/original/uLSEfTUCaTZ55ltUSUeVgL4E2xt.jpg","certification":"14","genres":["Drama","História"],"trailer":"N/A"},
