"663260":{"id":"663260","name":"Caixa Preta","slug":"caixa-preta","original_title":"Boîte noire","overview":"O que aconteceu a bordo do voo Dubai-Paris antes de bater no maciço alpino? Técnico na BEA, autoridade responsável pelas investigações de segurança na aviação civil, Mathieu Vasseur é o investigador principal desse desastre aéreo sem precedentes. Teria sido um erro do piloto? Falha técnica? Ato terrorista? A análise minuciosa das caixas pretas fará com que Mathieu conduza secretamente a sua própria investigação. Ele ainda não sabe até onde vai a sua busca pela verdade.","first_air_date":"2021-09-08","runtime":130,"episode_run_time":[130],"vote_average":7.3,"created_by":["24 25 Films","WY Productions"],"production_companies":[{"name":"24 25 Films"},{"name":"WY Productions"}],"cast":["Pierre Niney","Lou de Laâge","André Dussollier","Sébastien Pouderoux","Olivier Rabourdin"],"backdrop_path":"https://image.tmdb.org/t/p/original/92tLofRwuX0mdqcybPz03xhpIgS.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Ee7gyWAF3OXRnsUOAMwB1Rwgmf.jpg","certification":"14","genres":["Mistério","Thriller","Drama"],"trailer":"N/A"},
"449563":{"id":"449563","name":"Megarromântico","slug":"megarromantico","original_title":"Isn't It Romantic","overview":"Natalie (Rebel Wilson) é uma jovem arquiteta bastante cética em relação ao amor, que se empenha para ser reconhecida por seu trabalho. Um dia, ao saltar do metrô, ela é assaltada em plena estação e, ao reagir, acaba batendo com a cabeça em uma pilastra. Ao despertar em um hospital, ela descobre que, misteriosamente, foi parar dentro de um filme de comédia romântica.","first_air_date":"2019-02-13","runtime":89,"episode_run_time":[89],"vote_average":6.2,"created_by":["New Line Cinema","Bron Studios","Broken Road Productions","Camp Sugar","Creative Wealth Media Finance","Little Engine"],"production_companies":[{"name":"New Line Cinema"},{"name":"Bron Studios"},{"name":"Broken Road Productions"},{"name":"Camp Sugar"},{"name":"Creative Wealth Media Finance"},{"name":"Little Engine"}],"cast":["Rebel Wilson","Liam Hemsworth","Adam Devine","प्रियंका चोपड़ा जोनस","Betty Gilpin"],"backdrop_path":"https://image.tmdb.org/t/p/original/4epIlsVpzk2k1fuFS2pzurpIQTJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/w0w61UOMCrTIFdKvXjWgn17UXjQ.jpg","certification":"N/A","genres":["Comédia","Fantasia","Romance"],"trailer":"N/A"},
