"10207":{"id":"10207","name":"Uma Carta de Amor","slug":"uma-carta-de-amor","original_title":"Message in a Bottle","overview":"Ao caminhar pela praia, Theresa Osborne (Robin Wright) encontra uma garrafa com uma carta romântica e extremamente sincera, pois era também uma despedida, um adeus. Ela fica tão impressionada que usa os meios que dispõe trabalhando como jornalista em Chicago e tenta saber quem escreveu a carta. Ela então descobre que foi escrita por Garret Blake (Kevin Costner), um construtor de barcos da Carolina do Norte, para Catherine (Susan Brightbill), sua esposa, e, ao conhecê-lo, fica sabendo que Catherine faleceu precocemente. Em pouco tempo surge uma atração mútua entre Theresa e Garret, mas os fantasmas que ele carrega não permitem que ele viva este novo amor por completo.","first_air_date":"1999-02-22","runtime":90,"episode_run_time":[90],"vote_average":6.3,"created_by":["Warner Bros. Pictures","Bel Air Entertainment","Tig Productions","Di Novi Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Bel Air Entertainment"},{"name":"Tig Productions"},{"name":"Di Novi Pictures"}],"cast":["Kevin Costner","Robin Wright","Paul Newman","John Savage","Illeana Douglas"],"backdrop_path":"https://image.tmdb.org/t/p/original/bHTAGzPTQ0aBm7gmfkSnqaHiajM.jpg","poster_path":"https://image.tmdb.org/t/p/original/6hUg0MBuxRPSLLZ6uNRSv8U4Eqs.jpg","certification":"L","genres":["Romance","Drama"],"trailer":"N/A"},
"9441":{"id":"9441","name":"Lado a Lado","slug":"lado-a-lado","original_title":"Stepmom","overview":"Uma jovem de doze anos e um garoto de sete, filhos de pais separados, não aceitam a nova namorada de seu pai, uma bela e renomada fotógrafa. O garoto ainda tolera a situação, mas a adolescente não se conforma com a separação e com fato de seu pai e a namorada viverem juntos, pois isto significa que as chances de reconciliação de seus pais se tornam quase nulas. Por sua vez, a mãe das crianças ainda alimenta esta briga, fazendo o gênero mãe perfeita.","first_air_date":"1998-12-25","runtime":125,"episode_run_time":[125],"vote_average":7.1,"created_by":["1492 Pictures","Columbia Pictures","Wendy Finerman Productions"],"production_companies":[{"name":"1492 Pictures"},{"name":"Columbia Pictures"},{"name":"Wendy Finerman Productions"}],"cast":["Julia Roberts","Susan Sarandon","Ed Harris","Jena Malone","Liam Aiken"],"backdrop_path":"https://image.tmdb.org/t/p/original/iteE4cNHQm8PWmWDuKcCCnMLhS3.jpg","poster_path":"https://image.tmdb.org/t/p/original/taDwz4JCanv9fkF6MjDKfNGxlkz.jpg","certification":"12","genres":["Drama","Romance","Comédia"],"trailer":"N/A"},
"37821":{"id":"37821","name":"Par Perfeito","slug":"par-perfeito","original_title":"Killers","overview":"Jen, conhece o homem perfeito. Seu nome é Spencer, ele é bonitão, educado e inteligente. Mas o que Jen não sabe, é que Spencer ganha a vida como matador de aluguel, contratado pelo governo. Eles vivem o casamento dos sonhos até que em uma bela manhã, o casal descobre que Spencer é o alvo de um golpe milionário. O que parecia ser um Par Perfeito transforma -se num jogo de vida ou morte, enquanto eles tentam lidar com sogros, sogras, casamento, manter as aparências e ainda sobreviver.","first_air_date":"2010-06-04","runtime":100,"episode_run_time":[100],"vote_average":6.0,"created_by":["Katalyst Films","Lionsgate","Aversano Films"],"production_companies":[{"name":"Katalyst Films"},{"name":"Lionsgate"},{"name":"Aversano Films"}],"cast":["Ashton Kutcher","Katherine Heigl","Tom Selleck","Catherine O'Hara","Katheryn Winnick"],"backdrop_path":"https://image.tmdb.org/t/p/original/hJ4xtZnejzfneeRqv2NaTzxJ1jp.jpg","poster_path":"https://image.tmdb.org/t/p/original/9xFcKDY9RFUidat3VU8QIlSrZmf.jpg","certification":"N/A","genres":["Ação","Comédia","Thriller","Romance"],"trailer":"Xn-MRAqsBGM"},
"9513":{"id":"9513","name":"Garfield 2","slug":"garfield-2","original_title":"Garfield: A Tail of Two Kitties","overview":"Breckin Meyer, Jeninfer Love Hewitt e Bill Muray estão de volta em uma nova aventura do gato favorito de todos, e desta vez, Garfield está dando um tratamento real à Inglaterra! É uma invasão de um tipo diferente quando Garfield, e seus amigos Jon e Odie, viajam a Londres e Garfield encontra um sósia, Prince, um bichano aristocrata que herdou um fabuloso castelo. Os dois trocam de lugar, e logo Garfield está vivendo na mordomia que ele gosta! Só há um pequeno probleminha: o covarde e maligno Lorde Dargis quer que o gato desapareça.","first_air_date":"2006-06-15","runtime":79,"episode_run_time":[79],"vote_average":5.6,"created_by":["20th Century Fox","Davis Entertainment","Dune Entertainment","Major Studio Partners","Ingenious Media","Ingenious Film Partners"],"production_companies":[{"name":"20th Century Fox"},{"name":"Davis Entertainment"},{"name":"Dune Entertainment"},{"name":"Major Studio Partners"},{"name":"Ingenious Media"},{"name":"Ingenious Film Partners"}],"cast":["Breckin Meyer","Jennifer Love Hewitt","Billy Connolly","Bill Murray","Tim Curry"],"backdrop_path":"https://image.tmdb.org/t/p/original/lrUeu7XMNaKJn6v8ps0DHqUE11L.jpg","poster_path":"https://image.tmdb.org/t/p/original/bXwKOr1LnYMetY7mROBQ3MFhb1a.jpg","certification":"L","genres":["Comédia","Família","Aventura"],"trailer":"N/A"},
"9535":{"id":"9535","name":"Máfia no Divã","slug":"mafia-no-diva","original_title":"Analyze This","overview":"Paul Vitti (Robert De Niro), o chefe de uma \"família\", tem repentinamente ataques de ansiedade por causa de problemas do passado. Assim, decide consultar secretamente Ben Sobel (Billy Crystal), um psiquiatra, pois se a história se espalhar vão dizer que ele está \"frouxo\". Mas o pior é que Vitti deseja estar curado em apenas duas semanas, quando acontecerá um grande reunião da Máfia, e Sobel está viajando para Miami, onde pretende se casar com Laura MacNamara (Lisa Kudrow). Vitti é o tipo de pessoa que está acostumado em ter qualquer pessoa que trabalhe para ele a disposição vinte e quatro horas por dia, assim Sobel passa a ser \"requisitado\" pelos capangas de Vitti nos horários e lugares mais impróprios, inclusive na hora de seu casamento. Paralelamente, os agentes federais até forjam provas para que Sobel torne-se seu informante e diga quando e aonde será esta reunião das \"famílias\".","first_air_date":"1999-03-05","runtime":103,"episode_run_time":[103],"vote_average":6.5,"created_by":["Spring Creek Pictures","Tribeca Productions","Baltimore Pictures","Warner Bros. Pictures","Village Roadshow Pictures","NPV Entertainment","Face Productions"],"production_companies":[{"name":"Spring Creek Pictures"},{"name":"Tribeca Productions"},{"name":"Baltimore Pictures"},{"name":"Warner Bros. Pictures"},{"name":"Village Roadshow Pictures"},{"name":"NPV Entertainment"},{"name":"Face Productions"}],"cast":["Robert De Niro","Billy Crystal","Lisa Kudrow","Chazz Palminteri","Kresh Novakovic"],"backdrop_path":"https://image.tmdb.org/t/p/original/oas0DvvhhaMncvn805LjepxeoZh.jpg","poster_path":"https://image.tmdb.org/t/p/original/avZDalXvozcwYXINCm7q5MvIcDC.jpg","certification":"14","genres":["Comédia","Crime"],"trailer":"N/A"},
