"11158":{"id":"11158","name":"Querida, Estiquei o Bebê","slug":"querida-estiquei-o-bebe","original_title":"Honey, I Blew Up the Kid","overview":"Aproveitando uma viagem de sua esposa, o cientista Wayne Szalinsky resolve levar seus filhos ao laboratório onde trabalha. Descuidado, não percebe que seu filho mais novo, o bebê Adam, recebe toda energia desprendida pelo complexo sistema inventado por ele. O resultado não poderia ser mais desastroso: o pequeno Adam acaba transformando-se em um bebê gigante, que não pára de crescer. Nada poderia detê-lo, nem mesmo o exército americano. Só uma brilhante idéia do cientista mais maluco que se tem notícia poderia salvar a cidade.","first_air_date":"1992-07-16","runtime":89,"episode_run_time":[89],"vote_average":5.3,"created_by":["Walt Disney Pictures","Touchwood Pacific Partners 1"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Touchwood Pacific Partners 1"}],"cast":["Rick Moranis","Marcia Strassman","Robert Oliveri","Daniel Shalikar","Joshua Shalikar"],"backdrop_path":"https://image.tmdb.org/t/p/original/r4Vx7kne6dovybAJR4LsR4eQCxP.jpg","poster_path":"https://image.tmdb.org/t/p/original/gbFeKn4lNwASNlHLWXW0nmhBA1B.jpg","certification":"livre","genres":["Aventura","Comédia","Família","Ficção científica"],"trailer":"N/A"},
