"9788":{"id":"9788","name":"Aprovados","slug":"aprovados","original_title":"Accepted","overview":"Bartleby Gaines (Justin Long) não é aprovado em nenhuma universidade e, para evitar a decepção dos pais, inventa um convite do fictício South Harmon Institute of Technology (S.H.I.T.). Seus amigos igualmente recusados também fazem uso da criação, mas a coisa fica séria quando os responsáveis passam a exigir maiores informações sobre o instituto. Determinado a levar a farsa adiante, o grupo se apropria de uma clínica abandonada, que logo é invadida por dezenas de estudantes reprovados.","first_air_date":"2006-08-18","runtime":93,"episode_run_time":[93],"vote_average":6.4,"created_by":["Universal Pictures","Shady Acres Entertainment"],"production_companies":[{"name":"Universal Pictures"},{"name":"Shady Acres Entertainment"}],"cast":["Justin Long","Jonah Hill","Blake Lively","Adam Herschman","Columbus Short"],"backdrop_path":"https://image.tmdb.org/t/p/original/mzSE77QAYqbuL73kXQGwVeqkzwa.jpg","poster_path":"https://image.tmdb.org/t/p/original/yppruoimnrfKfbgvq9705bS0dDf.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
