"15413":{"id":"15413","name":"Viva! A Babá Morreu","slug":"viva-a-baba-morreu","original_title":"Don't Tell Mom the Babysitter's Dead","overview":"Durante o verão a mãe de algumas crianças decide ter merecidas férias com seu namorado e deixa uma \"bondosa velhinha\", Sra. Sturak (Eda Reiss Merin), para cuidar dos seus filhos. Porém, ela logo se revela uma pessoa intolerante e arbitrária. No entanto, Sturak logo morre de um ataque do coração e as crianças decidem não revelar esta morte, pois isto faria sua mãe retornar.","first_air_date":"1991-06-07","runtime":102,"episode_run_time":[102],"vote_average":6.1,"created_by":["Cinema Plus","Douglas","HBO","Mercury","Outlaw Productions"],"production_companies":[{"name":"Cinema Plus"},{"name":"Douglas"},{"name":"HBO"},{"name":"Mercury"},{"name":"Outlaw Productions"}],"cast":["Christina Applegate","Joanna Cassidy","John Getz","Josh Charles","Keith Coogan"],"backdrop_path":"https://image.tmdb.org/t/p/original/bF4YrmQKdA3v5CNZq8pc0CIqver.jpg","poster_path":"https://image.tmdb.org/t/p/original/m7ZvOPLY0S641JaBuVuwdIaWyJB.jpg","certification":"N/A","genres":["Comédia","Família"],"trailer":"N/A"},
"11978":{"id":"11978","name":"Homens de Honra","slug":"homens-de-honra","original_title":"Men of Honor","overview":"Carl Brashear, um jovem negro, entra para a Marinha americana nos 50, época em que o racismo prevalecia no país. O jovem enfrenta o preconceito de seus colegas brancos e de seu instrutor, mas sua coragem e determinação conquistam o respeito de todos.","first_air_date":"2000-09-13","runtime":129,"episode_run_time":[129],"vote_average":7.5,"created_by":["Fox 2000 Pictures"],"production_companies":[{"name":"Fox 2000 Pictures"}],"cast":["Robert De Niro","Cuba Gooding Jr.","Charlize Theron","Aunjanue Ellis-Taylor","Hal Holbrook"],"backdrop_path":"https://image.tmdb.org/t/p/original/laNHiehbOHYM3y9FVFfqmLuX8X5.jpg","poster_path":"https://image.tmdb.org/t/p/original/gv6BZRbfJGxBp9tFFKMuXuJGwTe.jpg","certification":"12","genres":["Drama"],"trailer":"N/A"},
"13920":{"id":"13920","name":"Meu Nome é Rádio","slug":"meu-nome-e-radio","original_title":"Radio","overview":"Anderson, Carolina do Sul, 1976, na escola secundária T. L. Hanna. Harold Jones (Ed Harris) é o treinador local de futebol americano, que fica tão envolvido em preparar o time que raramente passa algum tempo com sua filha, Mary Helen (Sarah Drew), ou sua esposa, Linda (Debra Winger). Jones conhece um jovem \"lento\", James Robert Kennedy (Cuba Gooding Jr.), mas Jones nem ninguém sabia o nome dele, pois ele não falava e só perambulava em volta do campo de treinamento. Jones se preocupa com o jovem quando alguns dos jogadores da equipe fazem uma \"brincadeira\" de péssimo gosto, que deixou James apavorado. Tentando compensar o que tinham feito com o jovem, Jones o coloca sob sua proteção, além de lhe dar uma ocupação. Como ainda não sabia o nome dele e pelo fato dele gostar de rádios, passou a se chamá-lo de Radio. Mas ninguém sabia que, pelo menos em parte, a razão da preocupação de Jones é que tentava não repetir uma omissão que cometera, quando era um garoto.","first_air_date":"2003-10-24","runtime":109,"episode_run_time":[109],"vote_average":7.3,"created_by":["Tollin/Robbins Productions","Revolution Studios","Columbia Pictures"],"production_companies":[{"name":"Tollin/Robbins Productions"},{"name":"Revolution Studios"},{"name":"Columbia Pictures"}],"cast":["Cuba Gooding Jr.","Ed Harris","Alfre Woodard","S. Epatha Merkerson","Debra Winger"],"backdrop_path":"https://image.tmdb.org/t/p/original/wDln5edQPFYMeKvakkYCLUXOPRP.jpg","poster_path":"https://image.tmdb.org/t/p/original/oIMyQjfUPLlhjpGaFnTWqggb7Fw.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
