"675327":{"id":"675327","name":"Uma Sombra na Nuvem","slug":"uma-sombra-na-nuvem","original_title":"Shadow in the Cloud","overview":"Uma piloto embarca em uma fortaleza voadora B-17 que transporta itens secretos. Enquanto tenta lidar com o machismo da equipe formada inteiramente por homens, a militar começa a perceber que algo estranho está acontecendo na aeronave. Além de uma emboscada dos japoneses, o esquadrão militar também tem que combater um inimigo misterioso presente dentro do próprio avião.","first_air_date":"2020-12-31","runtime":83,"episode_run_time":[83],"vote_average":5.8,"created_by":["Four Knights Film","Rhea Films","Automatik Entertainment","Endeavor Content","Hercules Film Fund","New Zealand Film Commission","Fulcrum Media Finance"],"production_companies":[{"name":"Four Knights Film"},{"name":"Rhea Films"},{"name":"Automatik Entertainment"},{"name":"Endeavor Content"},{"name":"Hercules Film Fund"},{"name":"New Zealand Film Commission"},{"name":"Fulcrum Media Finance"}],"cast":["Chloë Grace Moretz","Nick Robinson","Beulah Koale","Taylor John Smith","Callan Mulvey"],"backdrop_path":"https://image.tmdb.org/t/p/original/aHYUj0hICtWZ5tPiCIm6pWUcjYK.jpg","poster_path":"https://image.tmdb.org/t/p/original/hMo1lNG4KnWZX6mxEaEoRiuyPtB.jpg","certification":"14","genres":["Terror","Ação","Guerra"],"trailer":"GF_BWflROxI"},
