"47327":{"id":"47327","name":"Fúria Sobre Rodas","slug":"furia-sobre-rodas","original_title":"Drive Angry","overview":"Milton (Nicolas Cage) se envolveu com pessoas erradas no passado, foi parar no inferno e acabou tendo sua filha assassinada. Agora sua neta está das mãos do líder da mesma seita satânica. Chegou a hora de Milton retornar do mundo das trevas para tentar salvá-la e, quem sabe, ter a sua redenção. Em sua jornada para descobrir o paradeiro da criança ele conhece Piper (Amber Heard), uma garçonete boa de briga e em busca de aventura. Era o que ele precisava para enfrentar seus inimigos e ainda driblar O Contador (William Fichtner), um fiel súdito do diabo disposto a tudo para levá-lo de volta para o príncipe da escuridão.","first_air_date":"2011-02-24","runtime":104,"episode_run_time":[104],"vote_average":5.5,"created_by":["Summit Entertainment","Saturn Films","Nu Image","Michael De Luca Productions","Millennium Media"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Saturn Films"},{"name":"Nu Image"},{"name":"Michael De Luca Productions"},{"name":"Millennium Media"}],"cast":["Nicolas Cage","Amber Heard","William Fichtner","Billy Burke","David Morse"],"backdrop_path":"https://image.tmdb.org/t/p/original/iDYwRgNbqH1MjYPafV31f8juUa9.jpg","poster_path":"https://image.tmdb.org/t/p/original/ysYTf7VEPAtHWDgBMqqfsKWKadF.jpg","certification":"16","genres":["Fantasia","Thriller","Ação","Crime"],"trailer":"DrTeZKfrcw8"},
