"347031":{"id":"347031","name":"Um Cadáver para Sobreviver","slug":"um-cadaver-para-sobreviver","original_title":"Swiss Army Man","overview":"Hank, um homem perdido no deserto, e sem esperanças, encontra um corpo no meio do caminho. Decidido em ficar amigo do morto, eles vão partir, juntos, em uma jornada surrealista para voltar para casa. Ao mesmo tempo em que Hank descobre que o corpo é a chave para sua sobrevivência, ele é forçado a convencer o morto o quanto vale a pena viver.","first_air_date":"2016-06-24","runtime":97,"episode_run_time":[97],"vote_average":6.9,"created_by":["BlackBird","Tadmor","Astrakan Films","Cold Iron Pictures","Prettybird"],"production_companies":[{"name":"BlackBird"},{"name":"Tadmor"},{"name":"Astrakan Films"},{"name":"Cold Iron Pictures"},{"name":"Prettybird"}],"cast":["Paul Dano","Daniel Radcliffe","Mary Elizabeth Winstead","Antonia Ribero","Timothy Eulich"],"backdrop_path":"https://image.tmdb.org/t/p/original/dxa8tPKsGYH7KQJew6OlKaeFRLX.jpg","poster_path":"https://image.tmdb.org/t/p/original/sDIFBt9ubWYi1xjNARvjCM5KaT.jpg","certification":"16","genres":["Comédia","Drama","Romance","Fantasia","Aventura"],"trailer":"N/A"},
