"10952":{"id":"10952","name":"New Jack City: A Gangue Brutal","slug":"new-jack-city-a-gangue-brutal","original_title":"New Jack City","overview":"Nino Brown (Wesley Snipes), um pequeno traficante de drogas, é convencido por um colega de gangue que a onda do futuro está em um derivado da cocaína, o crack. Nino vê o potencial do crack como negócio e se estabelece por conta própria, chefiando uma quadrilha e matando seus rivais até assumir um complexo de apartamentos. Para detê-lo surgem Scottie Appleton (Ice-T) e Nick Peretti (Judd Nelson), dois policiais disfarçados. Appleton quer pegar Nino, pois ele assassinou a mãe de Scottie como parte de uma iniciação de quadrilha. Também envolvido está Pookie (Chris Rock), um ex-viciado que também quer derrubar Nino.","first_air_date":"1991-03-08","runtime":100,"episode_run_time":[100],"vote_average":6.6,"created_by":["Jacmac Films","Jackson-McHenry Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"Jacmac Films"},{"name":"Jackson-McHenry Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Wesley Snipes","Ice-T","Allen Payne","Chris Rock","Mario Van Peebles"],"backdrop_path":"https://image.tmdb.org/t/p/original/u3fFEz0NdoyXL3UUxTPNqeM2vrc.jpg","poster_path":"https://image.tmdb.org/t/p/original/g9GV6T1bSiP9xDdDuN26ZUB6nAj.jpg","certification":"N/A","genres":["Thriller","Crime","Drama"],"trailer":"N/A"},
