"617708":{"id":"617708","name":"A Chorona","slug":"a-chorona","original_title":"La Llorona","overview":"O general aposentado, Enrique, finalmente enfrenta julgamento pelo massacre genocida de milhares de maias décadas atrás. Enquanto uma horda de manifestantes raivosos ameaça invadir seu lar opulento, as mulheres da casa – sua esposa arrogante, filha em conflito e neta precoce – refletem sobre sua responsabilidade de proteger Enrique, errático e senil, contra as verdades devastadoras que são reveladas publicamente enquanto começam a sentir uma força sobrenatural em busca de vingança por seus crimes. Enquanto isso, grande parte dos empregados da família foge, deixando apenas a governanta leal Valeriana até que uma misteriosa jovem indígena chega…","first_air_date":"2019-07-25","runtime":97,"episode_run_time":[97],"vote_average":6.4,"created_by":["La Casa de Producción","Les Films du Volcan","L'Aide aux Cinémas du Monde","El Ministerio de Cultura Y Deportes de Guatamala"],"production_companies":[{"name":"La Casa de Producción"},{"name":"Les Films du Volcan"},{"name":"L'Aide aux Cinémas du Monde"},{"name":"El Ministerio de Cultura Y Deportes de Guatamala"}],"cast":["María Mercedes Coroy","Sabrina De La Hoz","Margarita Kénefic","Julio Díaz","María Telón"],"backdrop_path":"https://image.tmdb.org/t/p/original/hXjK21t5S6WRR8HnG3apYpZ5lJW.jpg","poster_path":"https://image.tmdb.org/t/p/original/Agi0zMOOOqQCn1kM2ds9k5wDamJ.jpg","certification":"12","genres":["Thriller","Terror","Drama"],"trailer":"05CaYYmDEBc"},
